// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AIModelMarketplace {
    struct Model {
        string name;
        string description;
        uint256 price;
        address payable creator;
        uint8 totalRatings;
        uint8 numRatings;
    }

    mapping(uint256 => Model) public models;
    uint256 public modelCount;

    function listModel(string memory name, string memory description, uint256 price) public {
        require(price > 0, "Price must be greater than zero");
        models[modelCount] = Model(name, description, price, payable(msg.sender), 0, 0);
        modelCount++;
    }

    function purchaseModel(uint256 modelId) public payable {
        Model storage model = models[modelId];
        require(msg.value == model.price, "Incorrect payment");
        model.creator.transfer(msg.value);
    }

    function rateModel(uint256 modelId, uint8 rating) public {
        require(rating >= 1 && rating <= 5, "Rating must be between 1 and 5");
        Model storage model = models[modelId];
        model.totalRatings += rating;
        model.numRatings++;
    }

    function getModelDetails(uint256 modelId) public view returns (
        string memory, string memory, uint256, address, uint256
    ) {
        Model memory model = models[modelId];
        uint256 avgRating = model.numRatings == 0 ? 0 : model.totalRatings / model.numRatings;
        return (model.name, model.description, model.price, model.creator, avgRating);
    }
}

